import React from "react";
const LaunchButton = () => {
  let buttonList = [];
  for (let i = 2006; i <= 2020; i++) {
    buttonList.push(
      <div className="col-lg-6">
        <button
          className="btn btn-secondary mt-4"
          onClick={() => {
            props.handleChange("year", i);
          }}
        >
          {i}
        </button>
      </div>
    );
  }
  return buttonList;
};
const Filter = (props) => {
  const { handleChange } = props;
  return (
    <>
      <span>Launch Year</span>
      <div className="row">
        <LaunchButton handleChange={handleChange} />
      </div>
      <hr />
      <span>Success launch</span>

      <div className="row">
        <div className="col-lg-6">
          {" "}
          <button
            className="btn btn-primary"
            onClick={() => {
              handleChange("launch_success", "true");
            }}
          >
            True
          </button>{" "}
        </div>
        <div className="col-lg-6">
          <button
            className="btn btn-primary"
            onClick={() => {
              handleChange("launch_success", "false");
            }}
          >
            False
          </button>
        </div>
      </div>
      <span>Successful landing</span>
      <div className="row">
        <div className="col-lg-6">
          {" "}
          <button
            className="btn btn-primary"
            onClick={() => {
              handleChange("land_success", "true");
            }}
          >
            True
          </button>{" "}
        </div>
        <div className="col-lg-6">
          <button
            className="btn btn-primary"
            onClick={() => {
              handleChange("land_success", "false");
            }}
          >
            False
          </button>
        </div>
      </div>
    </>
  );
};
export default Filter;
